at includes spare parts distribution, maintenance, and after sales services.\\r\\n\\r\\n\",\"website_id\":\"1\",\"published\":1,\"component_data\":\"\"}',4,0,1,4,1,NULL,'2017-05-29 09:38:51','2017-07-30 17:01:11',''),(11,'English About Page Who We Are','{\"_method\":\"PATCH\",\"_token\":\"1x5QEq1dMKvVh2xPBv9yIKSj76YLJ4ipUKTch5oW\",\"component_template_id\":\"5\",\"name\":\"English About Page Who We Are\",\"title\":\"WHO ARE WE?!\",\"name1\":\"Dr. Raouf Ghabbour\",\"position1\":\"Chairman of the Board of Directors and Chief Executive Officer\",\"file1\":\"person1.jpg\",\"name2\":\"Mr. Nader Ghabbour\",\"position2\":\"Group Chief Operating Officer\",\"file2\":\"person2.jpg\",\"name3\":\"Eng. Sameh Ali\",\"position3\":\"Senior Vice President Commercial Vehicles and Construction equipment \",\"file3\":\"person3.jpg\",\"website_id\":\"1\",\"published\":1,\"component_data\":\"\"}',5,0,1,4,1,NULL,'2017-05-29 09:43:21','2017-07-30 17:03:26',''),(12,'English About Page Mission and Vision','{\"_method\":\"PATCH\",\"_token\":\"ixqbNECp7xQ1veXVSOJ8Lyi9RW03fTsS5JsDyMNE\",\"component_template_id\":\"6\",\"name\":\"English About Page Mission and Vision\",\"image_alt\":\"mission and vision\",\"image_title\":\"mission and vision\",\"component_data\":\"\",\"website_id\":\"1\",\"published\":1,\"file\":\"image001.png\"}',6,0,1,3,1,NULL,'2017-05-29 09:44:48','2017-08-22 15:31:27',''),(13,'English Main Menu','{\"_token\":\"Ab9eaHIHf5EkDcEZWPWti8FPqRbfg1PMbuWVJR2P\",\"component_template_id\":\"7\",\"name\":\"English Main Menu\",\"slot_name\":\"\",\"link_text_1\":\"HOME\",\"link_url_1\":\"ghabbour_commercial_vehicles/home\",\"link_text_2\":\"ABOUT\",\"link_url_2\":\"ghabbour_commercial_vehicles/about\",\"link_text_3\":\"LINE OF BUSINESS\",\"link_url_3\":\"/#\",\"link_text_4\":\"FUSO \",\"link_url_4\":\"#\",\"link_text_5\":\"VOLVO CE\",\"link_url_5\":\"#\",\"link_text_6\":\"VOLVO BUSES\",\"link_url_6\":\"#\",\"link_text_7\":\"VOLVO TRUCKS\",\"link_url_7\":\"#\",\"link_text_8\":\"LOCATIONS\",\"link_url_8\":\"/#\",\"link_text_9\":\"CONTACT US\",\"link_url_9\":\"/#\",\"published\":1,\"website_id\":\"1\"}',7,0,1,1,1,NULL,'2017-06-01 07:44:20','2017-06-02 23:35:26',''),(14,'English Homepage Contact us Right Side Bar','{\"_method\":\"PATCH\",\"_token\":\"IjJRgO69mjhmMPsMBb8nRcR09Ycy40l9pterQdRG\",\"component_template_id\":\"9\",\"name\":\"English Homepage Contact us Right Side Bar\",\"title\":\"Contact Us\",\"text\":\"You can send us a message through \",\"link\":\"More Info\",\"url\":\"fuso\\/contact_us\",\"website_id\":\"3\",\"published\":1,\"component_data\":\"\"}',9,0,3,3,1,NULL,'2017-06-04 11:59:28','2017-07-30 18:57:36',''),(15,'English Homepage Map','{\"_method\":\"PATCH\",\"_token\":\"QbgNPQHqArLdCnvbKPSAIU40RJHsZ5URUkNF4yXS\",\"component_template_id\":\"10\",\"name\":\"English Homepage Map\",\"title\":\"EGYPT\",\"name1\":\"Ghabbour Auto\",\"link_text\":\"Web Site\",\"link_url\":\"\\/#\",\"address\":\"Km 3 - Cairo Alexandria Agriculture road, Cairo, Egypt\",\"fax\":\"+2 02 42104494\",\"phone\":\"+2 02 42107797\",\"website_id\":\"3\",\"published\":1,\"file1\":\"map_base_004.jpg\",\"component_data\":\"\"}',10,0,3,2,1,NULL,'2017-06-04 12:03:24','2017-07-30 18:31:25',''),(16,'English Genuine Services template title-description','{\"_token\":\"zvV0wCxw4CYctrUqDdG5gvTAdMkxz20f6QOA2iZ4\",\"component_template_id\":\"11\",\"name\":\"title_desc\",\"title\":\"Genuine Services\",\"description\":\"Our highly skilled and specially trained technicians in our extensive network of service centers spread across more than 160 countries are ready to address all your service needs with the highest grade of quality and reliability. We continuously look to improve ourselves to offer you the best value for your money.\",\"published\":1,\"website_id\":\"3\"}',11,0,3,3,1,NULL,'2017-06-05 07:24:07','2017-06-05 07:25:07',''),(17,'English Genuine Services template genuine-services','{\"_token\":\"zvV0wCxw4CYctrUqDdG5gvTAdMkxz20f6QOA2iZ4\",\"component_template_id\":\"12\",\"name\":\"English Genuine Services template genuine-services\",\"title1\":\"Quality Service & Support\",\"description1\":\"Reliable consultation and the quality of the service network determine how well and how long your truck performs. Trust our trained technicians to ensure high quality.\",\"title2\":\"Top-Class Technology\",\"description2\":\"Mitsubishi Fuso continues to develop innovate new technology for your driving comfort. Our knowledgeable technicians ensure the technology stays up to date.\",\"title3\":\"Genuine Parts Availability\",\"description3\":\"The availability of the required genuine parts determines the downtime of your vehicle. Turn to your Mitsubishi Fuso dealer for quick supply of the genuine parts needed to keep your truck running.\",\"image_alt\":\"Genuine Services\",\"image_title\":\"Genuine Services\",\"published\":1,\"website_id\":\"3\",\"file\":\"genuine_data_bg.png\"}',12,0,3,3,1,NULL,'2017-06-05 07:41:31','2017-06-05 07:41:31',''),(18,'English Genuine Services template genuine-services-paragraph ','{\"_token\":\"zvV0wCxw4CYctrUqDdG5gvTAdMkxz20f6QOA2iZ4\",\"component_template_id\":\"13\",\"name\":\"English Genuine Services template genuine-services-paragraph \",\"description\":\"At FUSO, we are consistently focused on providing our best service to fulfill our customer\\u2019s satisfaction.\\r\\nTo accomplish this goal, we continuously train our mechanics team as well as our service and parts sales team throughout the year. As part of our special training, a \\u201cService Contest\\u201d is held every year to improve the skills of our service teams. In this context the \\u201cCustomer Service Contest 2016\\u201d took place with participants from the FUSO technician team and service and parts sales team - all in one to fulfill our customer\\u2019s satisfaction level at the highest.\\r\\nPlease take a look at the video below to see the highest efforts made by all the attendants at the Customer Service Contest 2016.\",\"published\":1,\"website_id\":\"3\"}',13,0,3,3,1,NULL,'2017-06-05 07:42:29','2017-06-05 07:42:29',''),(19,'English  Services template services-text-img','{\"_method\":\"PATCH\",\"_token\":\"c4qD9B0DSbV2HDE6mCR1HUtT3HIToRTXjKRBTg1c\",\"component_template_id\":\"14\",\"name\":\"English  Services template services-text-img\",\"title\":\"\",\"file\":\"FUSO_Website_Services_Page_Banner.jpg\",\"component_data\":\"\",\"website_id\":\"3\",\"published\":1}',14,0,3,2,1,NULL,'2017-06-05 07:45:47','2017-08-22 13:41:06',''),(21,'English We Promise template inner page feature photo','{\"_token\":\"zvV0wCxw4CYctrUqDdG5gvTAdMkxz20f6QOA2iZ4\",\"component_template_id\":\"15\",\"name\":\"English We Promise template inner page feature photo\",\"published\":1,\"website_id\":\"3\",\"file\":\"inner.png\",\"image_alt\":\"We Promise\",\"image_title\":\"We Promise\"}',15,0,3,3,1,NULL,'2017-06-05 09:13:32','2017-06-05 09:59:22',''),(22,'English We Promise template right img ','{\r\n  \"_token\": \"zvV0wCxw4CYctrUqDdG5gvTAdMkxz20f6QOA2iZ4\",\r\n  \"component_template_id\": \"16\",\r\n  \"name\": \"English We Promise template inner page feature photo\",\r\n  \"published\": 1,\r\n  \"website_id\": \"3\",\r\n  \"file\": \"right.png\",\r\n  \"image_alt\": \"We Promise\",\r\n  \"image_title\": \"We Promise\"\r\n}',16,0,3,3,1,NULL,'2017-06-05 09:14:29','2017-06-05 11:47:42',''),(23,'English We Promise template text','{\"_token\":\"zvV0wCxw4CYctrUqDdG5gvTAdMkxz20f6QOA2iZ4\",\"component_template_id\":\"17\",\"name\":\"English We Promise template text\",\"title1\":\"Responsive and responsible customer care is a FUSO hallmark.\",\"description1\":\"With the closest dealership network in Japan and a global network of excellent distributors and service partners, FUSO customers can rest assured that their vehicles are always be maintained in excellent working, profit generating condition.\\r\\n \\r\\nOur \\u201cWE PROMISE\\u201d* service concept ensures a consistently high genuine service experience for customers in order not only to keep their vehicles running smoothly but also to minimize its downtime by having essential maintenance properly implemented together with high quality of genuine parts on customer\\u2019s vehicles.\",\"title2\":\"*Available in participating markets. For more information please contact your local dealer.\",\"published\":1,\"website_id\":\"3\"}',17,0,3,3,1,NULL,'2017-06-05 09:16:15','2017-06-05 09:16:15',''),(24,'English We Promise services-text-img','{\"_method\":\"PATCH\",\"_token\":\"c4qD9B0DSbV2HDE6mCR1HUtT3HIToRTXjKRBTg1c\",\"component_template_id\":\"14\",\"name\":\"English We Promise services-text-img\",\"title\":\"\",\"component_data\":\"\",\"website_id\":\"3\",\"published\":1,\"file\":\"FUSO_Website_Services_Page_Banner.jpg\"}',14,0,3,2,1,NULL,'2017-06-05 10:11:02','2017-08-22 13:39:43',''),(25,'English roadsideAssistance template services-header_sections','{\"_token\":\"zvV0wCxw4CYctrUqDdG5gvTAdMkxz20f6QOA2iZ4\",\"component_template_id\":\"18\",\"name\":\"English roadsideAssistance template services-header_sections\",\"title\":\"Roadside Assistance\",\"published\":1,\"website_id\":\"3\"}',18,0,3,3,1,NULL,'2017-06-05 12:40:46','2017-06-05 12:40:46',''),(26,'English roadsideAssistance template parts_head_and_text','{\"_method\":\"PATCH\",\"_token\":\"IjJRgO69mjhmMPsMBb8nRcR09Ycy40l9pterQdRG\",\"component_template_id\":\"19\",\"name\":\"English roadsideAssistance template parts_head_and_text\",\"title\":\"Inspection and Maintenance\",\"description\":\"GB Egypt provides a full-service support for Mitsubishi Fuso owners to ensure highest vehicle\\u2019s uptime.\",\"website_id\":\"3\",\"published\":1,\"component_data\":\"\"}',19,0,3,3,1,NULL,'2017-06-05 12:41:41','2017-07-30 19:21:46',''),(27,'English roadsideAssistance template parts_head_and_text2','{\"_method\":\"PATCH\",\"_token\":\"IjJRgO69mjhmMPsMBb8nRcR09Ycy40l9pterQdRG\",\"component_template_id\":\"20\",\"name\":\"English roadsideAssistance template parts_head_and_text2\",\"title\":\"Inspection and Maintenance\",\"description\":\"Mobile Service: Whenever you need, wherever you are! \\r\\nOur fully equipped mobile service trucks and highly trained technicians can service your vehicle at your workplace or at any requested location. To make your reservation, simply give us a call to bring our most experienced and professional technicians at your doorstep.\\r\\n\",\"website_id\":\"3\",\"published\":1,\"component_data\":\"\"}',20,0,3,3,1,NULL,'2017-06-05 12:42:16','2017-07-30 19:22:45',''),(28,'English We Promise template inner page feature photo2','{\"_token\":\"zvV0wCxw4CYctrUqDdG5gvTAdMkxz20f6QOA2iZ4\",\"component_template_id\":\"21\",\"name\":\"English We Promise template inner page feature photo2\",\"published\":1,\"website_id\":\"3\",\"file\":\"section2.png\"}',21,0,3,3,1,NULL,'2017-06-05 12:50:16','2017-06-05 12:50:16',''),(29,'English roadsideAssistance template inner page feature photo	','{\"_token\":\"zvV0wCxw4CYctrUqDdG5gvTAdMkxz20f6QOA2iZ4\",\"component_template_id\":\"15\",\"name\":\"English roadsideAssistance template inner page feature photo\\t\",\"published\":1,\"website_id\":\"3\",\"file\":\"section2.png\"}',15,0,3,3,1,NULL,'2017-06-05 13:09:31','2017-06-05 13:09:31',''),(31,'English Inspection and Maintenance template services-header_sections','{\"_token\":\"zirJO0Gt9EBTwNxjb3uHcPPMkhYEcoy2DhBYmghQ\",\"component_template_id\":\"18\",\"name\":\"English Inspection and Maintenance template services-header_sections\",\"title\":\"Recording Results of inspection and maintenance\",\"published\":1,\"website_id\":\"3\"}',18,0,3,3,1,NULL,'2017-06-06 06:40:15','2017-06-06 06:40:15',''),(32,'English Inspection and Maintenance template services-text-img','{\"_method\":\"PATCH\",\"_token\":\"c4qD9B0DSbV2HDE6mCR1HUtT3HIToRTXjKRBTg1c\",\"component_template_id\":\"14\",\"name\":\"English Inspection and Maintenance template services-text-img\",\"title\":\"\",\"file\":\"FUSO_Website_Services_Page_Banner.jpg\",\"component_data\":\"\",\"website_id\":\"3\",\"published\":1}',14,0,3,2,1,NULL,'2017-06-06 06:42:27','2017-08-22 13:40:22',''),(33,'English Inspection and Maintenance  template service3 box	','{\"_token\":\"zirJO0Gt9EBTwNxjb3uHcPPMkhYEcoy2DhBYmghQ\",\"component_template_id\":\"23\",\"name\":\"English Inspection and Maintenance  template service3 box\\t\",\"description\":\"Please be reminded and utilize the below record sheets included in the Owner\\u2019s Handbook and\\/or Service Booklet to record the inspection and maintenance results.\\r\\n \\r\\nInspection and maintenance are important to maintain your vehicle in the best condition, however, to keep the record is just as important. Keeping all updated results including any minor inspection and maintenance performed by you, enables appropriate maintenance and management.\\r\\n \\r\\nThe owner of the truck is fully responsible for proper inspection and maintenance. Owner\\u2019s Handbook and\\/or Service Booklet is the guidebook for this purpose. When inspection and maintenance are performed, results must be recorded in the Owner\\u2019s Handbook and\\/or Service Booklet which is to be used as a lifetime logbook of the vehicle.\\r\\n \\r\\nMFTBC reserves the right to void any warranty if the periodical inspection designated by MFTBC is not carried out according to the MFTBC guideline.\",\"published\":1,\"website_id\":\"3\"}',23,0,3,3,1,NULL,'2017-06-06 06:48:56','2017-06-06 06:48:56',''),(34,'English Inspection and Maintenance template service3 box2','{\"_token\":\"zirJO0Gt9EBTwNxjb3uHcPPMkhYEcoy2DhBYmghQ\",\"component_template_id\":\"24\",\"name\":\"English Inspection and Maintenance template service3 box2\",\"description\":\"Periodical Inspection and Maintenance Record\\r\\nRecord actual conditions of Periodical inspection and maintenance including Manufacturer designated inspection items.\\r\\n \\r\\nPeriodical Inspection Record\\r\\nRecord results of New vehicle inspection and Periodical inspection in addition to outline of the maintenance.\\r\\n \\r\\nAny other Maintenance Record\\r\\nRecord replacements of oils\\/elements, etc. and actual condition of extraordinary maintenance.\\r\\nWhen inspection and maintenance are performed, results must be recorded in the Owner\\u2019s Handbook and\\/or Service Booklet which is to be used as a lifetime logbook of the vehicle.\\r\\n \\r\\nInspection Record of Severe Conditions\\r\\n(if applicable)\\r\\nRecord actual conditions at the time of use under severe conditions.\",\"published\":1,\"website_id\":\"3\"}',24,0,3,3,1,NULL,'2017-06-06 06:51:31','2017-06-06 06:51:31',''),(35,'English inspection and maintenance  template booklet','{\"_token\":\"zirJO0Gt9EBTwNxjb3uHcPPMkhYEcoy2DhBYmghQ\",\"component_template_id\":\"26\",\"name\":\"English inspection and maintenance  template booklet\",\"title\":\"The Service Booklet\",\"description\":\"The Service Booklet contains the warranty on new vehicle and inspection\\/ maintenance schedules together with information and suggestions, which will help to always maintain the vehicle in good condition. It is provided with every new vehicle.\",\"published\":1,\"website_id\":\"3\",\"file\":\"bookllet.png\"}',26,0,3,3,1,NULL,'2017-06-06 07:06:05','2017-06-06 07:06:05',''),(36,'English inspection and maintenance  template guidline','{\"_token\":\"zirJO0Gt9EBTwNxjb3uHcPPMkhYEcoy2DhBYmghQ\",\"component_template_id\":\"25\",\"name\":\"English inspection and maintenance  template guidline\",\"description\":\"The FUSO Maintenance Guidebook is the guide for periodic maintenance from a technical point of view. To extend the life of your truck, minimize problems and increase driving safety, follow the instructions of the SERVICE BOOKLET by using FUSO Maintenance Guidebook as a reference.\",\"titleLink\":\"FUSO Maintenance Guidebook\",\"link\":\"http://www.mitsubishi-fuso.com/content/dam/core/pdf/en/service/inspection/Maintenance-Guide-Book_EN_three_diamond.pdf\",\"published\":1,\"website_id\":\"3\",\"file\":\"guid.png\"}',25,0,3,3,1,NULL,'2017-06-06 07:08:46','2017-06-06 07:16:12',''),(37,'English inspection and maintenance template pdf','{\"_token\":\"zirJO0Gt9EBTwNxjb3uHcPPMkhYEcoy2DhBYmghQ\",\"component_template_id\":\"27\",\"name\":\"English inspection and maintenance template pdf\",\"title_Link1\":\"Example of periodical inspection (LTD) \",\"link1\":\"http:\\/\\/www.mitsubishi-fuso.com\\/content\\/dam\\/core\\/pdf\\/en\\/service\\/inspection\\/Example%20of%20periodical%20inspection.pdf\\/subassets\\/page1.pdf\",\"title_Link2\":\"Example of daily inspection (LTD) \",\"link2\":\"http:\\/\\/www.mitsubishi-fuso.com\\/content\\/dam\\/core\\/pdf\\/en\\/service\\/inspection\\/Example%20of%20daily%20inspection.pdf\\/subassets\\/page1.pdf\",\"published\":1,\"website_id\":\"3\",\"file1\":\"pdf1.png\",\"file2\":\"pdf2.png\"}',27,0,3,3,1,NULL,'2017-06-06 07:19:01','2017-06-06 07:19:01',''),(38,'English inspection and maintenance  template important info','{\"_token\":\"zirJO0Gt9EBTwNxjb3uHcPPMkhYEcoy2DhBYmghQ\",\"component_template_id\":\"28\",\"name\":\"English inspection and maintenance  template important info\",\"title_Link1\":\"Important information for INOMAT-II trucks \",\"link1\":\"http:\\/\\/www.mitsubishi-fuso.com\\/content\\/fuso\\/en\\/service\\/service\\/information.html\",\"title_Link2\":\"Important information regarding automatic generated DPF \",\"link2\":\"http:\\/\\/www.mitsubishi-fuso.com\\/content\\/fuso\\/en\\/service\\/service\\/inomat.html\",\"published\":1,\"website_id\":\"3\",\"file1\":\"1.png\",\"file2\":\"inspection_booklet_e.png\"}',28,0,3,3,1,NULL,'2017-06-06 07:44:15','2017-06-06 07:44:15',''),(39,'English Inspection and Maintenance template inaeption_service_box','{\"_method\":\"PATCH\",\"_token\":\"IjJRgO69mjhmMPsMBb8nRcR09Ycy40l9pterQdRG\",\"component_template_id\":\"22\",\"name\":\"English Inspection and Maintenance template inaeption_service_box\",\"title\":\"Inspection and Maintenance\",\"description1\":\"Please be sure to conduct below inspection and maintenance based on the Owner\\u2019s Handbook and\\/or Service Booklet equipped in your vehicle, for lasting safety and comfort with your vehicle.\\r\\n\",\"description2\":\"1. Daily inspection (pre-operational)\\r\\n2. New Vehicle inspection (1,000km, 5,000km)\\r\\n3. Periodical inspection \\r\\n4. Periodical replacement parts\\r\\nHow and when to inspect\\/service your vehicle for daily inspections (pre-operational) and oil\\/lubricants are written in the Owner\\u2019s Handbook summarized as inspection procedure. Please present the Owner\\u2019s Handbook and\\/or Service Booklet for GB Egypt, MFTBC authorized distrbutor, to record the maintenance condition. This record must be filled and certified by the MFTBC authorized workshop. In the case any other documents\\/records than \\u201cPeriodical Inspection Record\\u201d are to be used, please keep them always together with the Owner\\u2019s Handbook and\\/or Service Booklet.\\r\\n\",\"description3\":\"  \",\"file\":\"bus.png\",\"website_id\":\"3\",\"published\":1,\"component_data\":\"\"}',22,0,3,3,1,NULL,'2017-06-06 08:09:15','2017-07-30 19:10:14',''),(40,'English Genuine Accessories  template partandservice_img','{\"_method\":\"PATCH\",\"_token\":\"c4qD9B0DSbV2HDE6mCR1HUtT3HIToRTXjKRBTg1c\",\"component_template_id\":\"29\",\"name\":\"English Genuine Accessories  template partandservice_img\",\"component_data\":\"\",\"website_id\":\"3\",\"published\":1,\"file\":\"FUSO Website Parts & Accessories Page Banner.jpg\"}',29,0,3,2,1,NULL,'2017-06-06 09:52:49','2017-08-22 13:38:47',''),(41,'English Genuine Services template parts_paragraph_tabs','{\"_method\":\"PATCH\",\"_token\":\"IjJRgO69mjhmMPsMBb8nRcR09Ycy40l9pterQdRG\",\"component_template_id\":\"30\",\"name\":\"English Genuine Services template parts_paragraph_tabs\",\"title\":\"Fuso Genuine Accessories\",\"description\":\"We have launched our comprehensive accessory parts line for international markets in 2014. We provide over 300 different items for heavy, medium and light duty trucks. We will introduce more parts which not only make your trucks look more attractive but also help enhancing fuel efficiencies and drivability.\",\"website_id\":\"3\",\"published\":1,\"component_data\":\"\"}',30,0,3,3,1,NULL,'2017-06-06 10:08:02','2017-07-30 19:06:18',''),(42,'English fuso parts value  template parts_paragraph_tabs','{\"_method\":\"PATCH\",\"_token\":\"IjJRgO69mjhmMPsMBb8nRcR09Ycy40l9pterQdRG\",\"component_template_id\":\"30\",\"name\":\"English fuso parts value  template parts_paragraph_tabs\",\"title\":\"Fuso Value Parts\",\"description\":\"Fuso Value Parts are a new concept in maintenance parts. Their aim is to ensure reliable operation and increase your profitability. Offering quality equivalent to that of our genuine parts at a reasonable price.\\r\\nFuso Value Parts are an additional choice of parts for Fuso customers. The quality of FVPs is secured and approved by MFTBC, at the same time we achieved attractive prices for customers. FVPs are specifically for owners with vehicles after warranty. On top of our current product line, more parts are planned to come.\",\"website_id\":\"3\",\"published\":1,\"component_data\":\"\"}',30,0,3,3,1,NULL,'2017-06-06 10:54:32','2017-07-30 19:05:29',''),(43,'English fuso value parts  template partandservice_img','{\"_method\":\"PATCH\",\"_token\":\"c4qD9B0DSbV2HDE6mCR1HUtT3HIToRTXjKRBTg1c\",\"component_template_id\":\"29\",\"name\":\"English fuso value parts  template partandservice_img\",\"component_data\":\"\",\"website_id\":\"3\",\"published\":1,\"file\":\"FUSO Website Parts & Accessories Page Banner.jpg\"}',29,0,3,2,1,NULL,'2017-06-06 10:56:01','2017-08-22 13:31:11',''),(44,'English Genuine Services templatevalue_parts_tab2_text_2image','{\"_token\":\"zirJO0Gt9EBTwNxjb3uHcPPMkhYEcoy2DhBYmghQ\",\"component_template_id\":\"31\",\"name\":\"English Genuine Services templatevalue_parts_tab2_text_2image\",\"description\":\"When should you compromise on quality and value when it comes to parts you need to operate your business? The short answer is: never. With Fuso Value Parts, you are assured of authentic parts of the highest precision manufacturing guaranteed by Mitsubishi Fuso, without having to pay a premium. For excellent value at affordable prices, we have made the choice easy.\",\"published\":1,\"website_id\":\"3\",\"file1\":\"fu.png\",\"file2\":\"fu2.png\"}',31,0,3,3,1,NULL,'2017-06-06 11:00:14','2017-06-06 11:00:14',''),(45,'English Genuine Parts  template partandservice_img','{\"_method\":\"PATCH\",\"_token\":\"c4qD9B0DSbV2HDE6mCR1HUtT3HIToRTXjKRBTg1c\",\"component_template_id\":\"29\",\"name\":\"English Genuine Parts  template partandservice_img\",\"component_data\":\"\",\"website_id\":\"3\",\"published\":1,\"file\":\"FUSO Website Parts & Accessories Page Banner.jpg\"}',29,0,3,2,1,NULL,'2017-06-07 06:53:02','2017-08-22 13:29:48',''),(46,'English Genuine Parts template parts_paragraph_tabs','{\"_token\":\"ChXSaNrfy48zMi9GnK0eHxNiCi1vNcp4aWcNx24E\",\"component_template_id\":\"30\",\"name\":\"English Genuine Parts template parts_paragraph_tabs\",\"title\":\"Genuine Parts\",\"description\":\"Engineered by FUSO with passion and precision just like your truck, to give you the best in quality & reliability. This means you can rely on increased longevity, availability, as well as enhancing the resale value of your vehicle. By choosing Fuso Genuine Parts you will benefit from maximum performance and safety at all times. The availability of the required genuine parts determines the downtime of your vehicle. Turn to your Mitsubishi Fuso dealer for quick supply of the genuine parts needed to keep your truck running.\\r\\n\",\"published\":1,\"website_id\":\"3\"}',30,0,3,3,1,NULL,'2017-06-07 06:58:17','2017-06-07 06:58:17',''),(47,'English genuine parts template inner page feature photo','{\"_token\":\"ChXSaNrfy48zMi9GnK0eHxNiCi1vNcp4aWcNx24E\",\"component_template_id\":\"15\",\"name\":\"English genuine parts template inner page feature photo\",\"published\":1,\"website_id\":\"3\",\"file\":\"149137689807