B2Zn3nHQMGx47OYi181mQWudtd2OYQW5jb6PAl\",\"component_template_id\":\"41\",\"name\":\"Fuso  English Buses pragraph\",\"slot_name\":\"\",\"title\":\"Our FUSO buses and vans are sold in various markets worldwide. Due to different emission regulation standards and other market specific circumstances, our buses and vans are highly customized for each specific market requirements. For further information on availability and specification of FUSO buses and vans in your market, please contact your local dealer or visit their website.\",\"published\":1,\"website_id\":\"3\"}',41,0,3,3,1,NULL,'2017-07-05 14:00:52','2017-07-05 14:00:52',''),(73,'Economic Efficiency Desc','{\"_token\":\"kW6HmPcjQSkW0iJ8t2amWVlZxuCLRlCbutGO9ec3\",\"component_template_id\":\"51\",\"name\":\"Economic Efficiency Desc\",\"description\":\"\\r\\n\\r\\nFUSO products are known for the best lifetime cost advantage, their benchmark fuel efficiency and ecology. We take into account not only the initial purchase price, but also cost and profit drivers, such as ease to repair and maintain, residual values, tax and insurance advantages, maintenance cycles and fuel efficiency. The Canter Eco Hybrid, for example, is the world\\u2019s most fuel efficient vehicle in its class, proven by independent fuel efficiency tests and product ratings. We share our passion for efficiency with our customers using the FUSO Fuel Cup, a championship that rewards the most efficient driver.\\r\\n\\r\\nOur plants are just as efficient and ecological as our products. We have already introduced a solar system in the Kawasaki plant and actively utilize it to generate electricity. At the same time, we constantly monitor our energy use using a state-of-the art Energy Management System (EMS). Green innovation is also a core objective in logistics, where FUSO is demonstrating environmental leadership by introducing modal shifts and milk run supply chains to reduce our CO2 emissions. \",\"published\":1,\"website_id\":\"3\",\"file_1\":\"1491378715719.png\"}',51,0,3,4,1,NULL,'0000-00-00 00:00:00','0000-00-00 00:00:00',''),(74,'English Fuso Brand template head_title_fuso_brand','{\"_token\":\"OrPlsrCa2KozTghndnPOsNB18Y2gJh9EHLllcZN6\",\"component_template_id\":\"53\",\"name\":\"English Fuso Brand template head_title_fuso_brand\",\"slot_name\":\"\",\"title\":\"Mitsubishi Fuso Truck and Bus Corporation\",\"published\":1,\"website_id\":\"3\"}',53,0,3,3,1,NULL,'2017-07-19 05:30:55','2017-07-19 05:30:55',''),(75,'English Fuso Brand template head_img_text_fuso_brand','{\"_token\":\"OrPlsrCa2KozTghndnPOsNB18Y2gJh9EHLllcZN6\",\"component_template_id\":\"54\",\"name\":\"English Fuso Brand template head_img_text_fuso_brand\",\"slot_name\":\"\",\"description\":\"The FUSO brand is known for its trusted quality, economic efficiency, solid & functional design and committed services. FUSO is the leading Japanese brand across many markets, known for its track record of technological innovations and high customer satisfaction based on the lowest total cost of ownership.\\r\\n\",\"published\":1,\"website_id\":\"3\",\"file_1\":\"9999.png\"}',54,0,3,3,1,NULL,'2017-07-19 05:34:53','2017-07-19 05:34:53',''),(76,'English Fuso Brand template page_tabs_fuso_brand','{\"_token\":\"OrPlsrCa2KozTghndnPOsNB18Y2gJh9EHLllcZN6\",\"component_template_id\":\"55\",\"name\":\"English Fuso Brand template page_tabs_fuso_brand\", \"slot_name\": \"\",\n  \"title1\": \"History\",\n  \"link1\": \"fuso_brands\",\n  \"title2\": \"Trusted Quality\",\n  \"link2\": \"trusted_quality\",\n  \"title3\": \"Economic Efficiency\",\n  \"link3\": \"economic_efficiency\",\n  \"title4\": \"Solid &FunctionalDesign\",\n  \"link4\": \"solidandfunctional\",\n  \"title5\": \"Committed Service\",\n  \"link5\": \"committed_services\",\n  \"published\": 1,\n  \"website_id\": \"3\"\n}',55,0,3,3,1,NULL,'2017-07-19 05:39:46','2017-07-19 05:39:46',''),(77,'English Fuso Brand template  history_img1_fuso_brand','{\"_token\":\"OrPlsrCa2KozTghndnPOsNB18Y2gJh9EHLllcZN6\",\"comp