ic_efficiency  template image_trusted_quality ','{\"_token\":\"OrPlsrCa2KozTghndnPOsNB18Y2gJh9EHLllcZN6\",\"component_template_id\":\"59\",\"name\":\"English  economic_efficiency  template image_trusted_quality \",\"slot_name\":\"\",\"published\":1,\"website_id\":\"3\",\"file_1\":\"lllll.png\"}',59,0,3,3,1,NULL,'2017-07-19 08:21:37','2017-07-19 08:21:37',''),(89,'English solidandfunctional  template head_title_fuso_brand','{\"_token\":\"OrPlsrCa2KozTghndnPOsNB18Y2gJh9EHLllcZN6\",\"component_template_id\":\"53\",\"name\":\"English solidandfunctional  template head_title_fuso_brand\",\"slot_name\":\"\",\"title\":\"Mitsubishi Fuso Truck and Bus Corporation\",\"published\":1,\"website_id\":\"3\"}',53,0,3,3,1,NULL,'2017-07-19 09:09:28','2017-07-19 09:09:28',''),(90,'English solidandfunctional  template head_img_text_fuso_brand','{\"_token\":\"OrPlsrCa2KozTghndnPOsNB18Y2gJh9EHLllcZN6\",\"component_template_id\":\"54\",\"name\":\"English solidandfunctional  template head_img_text_fuso_brand\",\"slot_name\":\"\",\"description\":\"The FUSO brand is known for its trusted quality, economic efficiency, solid & functional design and committed services. FUSO is the leading Japanese brand across many markets, known for its track record of technological innovations and high customer satisfaction based on the lowest total cost of ownership.\",\"published\":1,\"website_id\":\"3\",\"file_1\":\"9999.png\"}',54,0,3,3,1,NULL,'2017-07-19 09:11:01','2017-07-19 09:11:01',''),(91,'English solidandfunctional  template page_tabs_fuso_brand','{\"_token\":\"OrPlsrCa2KozTghndnPOsNB18Y2gJh9EHLllcZN6\",\"component_template_id\":\"55\",\"name\":\"English solidandfunctional  template page_tabs_fuso_brand\", \"slot_name\": \"\",\"title1\":\"History\",\"link1\":\"fuso_brands\",\n  \"title2\": \"Trusted Quality\",\n  \"link2\": \"trusted_quality\",\n  \"title3\": \"Economic Efficiency\",\n  \"link3\": \"economic_efficiency\",\n  \"title4\": \"Solid &FunctionalDesign\",\n  \"link4\": \"solidandfunctional\",\n  \"title5\": \"Committed Service\",\n  \"link5\": \"committed_services\",\n  \"published\": 1,\n  \"website_id\": \"3\"\n}',55,0,3,3,1,NULL,'2017-07-19 09:13:51','2017-07-19 09:32:32',''),(92,'English   solidandfunctional  template left_img_text_trusted_quality','{\"_token\":\"OrPlsrCa2KozTghndnPOsNB18Y2gJh9EHLllcZN6\",\"component_template_id\":\"58\",\"name\":\"English   solidandfunctional  template left_img_text_trusted_quality\",\"slot_name\":\"\",\"description\":\"FUSO vehicles provide the highest satisfaction of ownership & usability. We are passionate about working vehicles and designing them with our customers\\u2019 daily comfort, utility value and ease of use in mind. With world firsts, such as the first pneumatic shift transmission, shock-reducing DUONIC\\u00ae dual-clutch transmission and onboard multi information display, FUSO has always provided its customers with the latest technology to improve their usability. Customer voices are often reflected in our designs, such as the lowered fuel cap for our city buses to enable staff of any height to refuel the vehicle safely and efficiently\\r\\n\\r\\n\\r\\n\\r\\nThe FUSO Canter pioneered an in-panel shifter because drivers needed to exit the cab from both sides in some applications. Our medium duty truck is available with two headlight configurations to meet the varying needs of construction and city applications.\\r\\n\\r\\n\\r\\n\\r\\nWe believe that good design combines utility and aesthetics, which is why we offer countless ways to customize vehicles using genuine accessories. Our color series trucks show the endless potential of one of the most advanced paint facilities in the business, offering our customers to use their vehicles as an extension of their own corporate color.\\r\\n\",\"published\":1,\"website_id\":\"3\",\"file_1\":\"leftt.png\"}',58,0,3,3,1,NULL,'2017-07-19 09:15:23','2017-07-19 09:18:56',''),(93,'English  solidandfunctional  template image_trusted_quality ','{\"_token\":\"OrPlsrCa2KozTghndnPOsNB18Y2gJh9EHLllcZN6\",\"component_template_id\":\"59\",\"name\":\"English  solidandfunctional  template image_trusted_quality \",\"slot_name\":\"\",\"published\":1,\"website_id\":\"3\",\"file_1\":\"looooo.png\"}',59,0,3,3,1,NULL,'2017-07-19 09:16:25','2017-07-19 09:16:25',''),(94,'English committed_services  template head_title_fuso_brand	','{\"_token\":\"OrPlsrCa2KozTghndnPOsNB18Y2gJh9EHLllcZN6\",\"component_template_id\":\"53\",\"name\":\"English committed_services  template head_title_fuso_brand\\t\",\"slot_name\":\"\",\"title\":\"Mitsubishi Fuso Truck and Bus Corporation\",\"published\":1,\"website_id\":\"3\"}',53,0,3,3,1,NULL,'2017-07-19 09:28:50','2017-07-19 09:28:50',''),(95,'English committed_services  template head_img_text_fuso_brand	','{\"_token\":\"OrPlsrCa2KozTghndnPOsNB18Y2gJh9EHLllcZN6\",\"component_template_id\":\"54\",\"name\":\"English committed_services  template head_img_text_fuso_brand\\t\",\"slot_name\":\"\",\"description\":\"The FUSO brand is known for its trusted quality, economic efficiency, solid & functional design and committed services. FUSO is the leading Japanese brand across many markets, known for its track record of technological innovations and high customer satisfaction based on the lowest total cost of ownership.\",\"published\":1,\"website_id\":\"3\",\"file_1\":\"9999.png\"}',54,0,3,3,1,NULL,'2017-07-19 09:31:12','2017-07-19 09:31:12',''),(96,'English committed_services template page_tabs_fuso_brand','{\"_token\":\"OrPlsrCa2KozTghndnPOsNB18Y2gJh9EHLllcZN6\",\"component_template_id\":\"55\",\"name\":\"English committed_services template page_tabs_fuso_brand\",\"slot_name\":\"\",\"title1\":\"History\",\"link1\":\"fuso_brands\",\"title2\":\"Trusted Quality\",\"link2\":\"trusted_quality\",\"title3\":\"Economic Efficiency\",\"link3\":\"economic_efficiency\",\"title4\":\"Solid & Functional Design\",\"link4\":\"solidandfunctional\",\"title5\":\"Committed Services\",\"link5\":\"committed_services\",\"published\":1,\"websit