GRADE!\",\"title2\":\"Volvo CE has a wide range of software options that go hand-in-hand with your machine.To increase the performance and fuel consumption of your machine, the optional software supports the features and your machine to ensure improved productivity. Advantages include increased safety and productivity, and reduced fuel consumption. Since no hardware is needed, Volvo Software Options are easily installed by your dealer.\",\"website_id\":\"2\",\"published\":1,\"component_data\":\"\"}',70,0,2,3,1,NULL,'2017-08-15 09:26:21','2017-08-15 11:37:21',''),(161,'English software  component p_right_image_first','{\"_token\":\"xUUBqQR9L1S5YTZuHnvzqBNYCosfWPJ5TnyRGqaV\",\"component_template_id\":\"103\",\"name\":\"English software  component p_right_image_first\",\"title1\":\"ENGINE AUTO SHUT DOWN\",\"description\":\"The Engine Auto Shut Down option is an easy way to cut down fuel consumption and decrease total costs. And while saving money, you also put less strain on the environment. Depending on the situation, a construction machine will often be idling for as much as 40 \\u2013 60 percent of its operating time. The Engine Auto Shut Down reduces this without impacting on productivity. It shuts down the engine when idling for more than 4 minutes when the machine is stationary and not in gear.\",\"title2\":\"CUT DOWN FUEL CONSUMPTION\",\"published\":1,\"website_id\":\"2\",\"file_1\":\"first.jpg\"}',103,0,2,3,1,NULL,'2017-08-15 11:13:01','2017-08-15 11:13:01',''),(162,'English software  component p_left_image_first','{\"_token\":\"xUUBqQR9L1S5YTZuHnvzqBNYCosfWPJ5TnyRGqaV\",\"component_template_id\":\"105\",\"name\":\"English software  component p_left_image_first\",\"title1\":\"ENGINE LOCK \\u2013 PIN-CODE\",\"description\":\"This option is an easy way to reduce the risk of the machine being stolen. When the option is activated, a PIN code needs to be entered to use the machine. This makes it more difficult for thieves and unauthorized users, but is easy to handle for the proper operator. All the operator needs to do is just enter the code and get to work.  Available for Articulated Haulers, Excavators and Wheel Loaders.  For more information about Engine Lock \\u2013 PIN-code, contact your local Volvo dealer.\",\"title2\":\"PROTECT YOUR MACHINE\",\"published\":1,\"website_id\":\"2\",\"file_1\":\"lefttt.jpg\"}',105,0,2,3,1,NULL,'2017-08-15 11:14:15','2017-08-15 11:14:15',''),(163,'English software  component p_right_image_second','{\"_token\":\"xUUBqQR9L1S5YTZuHnvzqBNYCosfWPJ5TnyRGqaV\",\"component_template_id\":\"104\",\"name\":\"English software  component p_right_image_second\",\"title1\":\"INCREASED ENGINE PROTECTION\",\"description\":\"The Increased Engine Protection option protects the engine from further damage due to problems in different engine systems, and thus reducing unnecessary and costly downtime. It automatically idles and shuts down the engine if critical levels are reached, such as coolant level and temperature, oil pressure and temperature, and boost pressure and temperature.  Available for Wheel Loaders, this also option prevents breakdowns caused by overriding of alarms, providing extra protection.  For more information about Increased Engine Protection, contact your local Volvo dealer.\",\"title2\":\"PROTECT YOUR ENGINE\",\"published\":1,\"website_id\":\"2\",\"file_1\":\"r2.jpg\"}',104,0,2,3,1,NULL,'2017-08-15 11:15:09','2017-08-15 11:15:09',''),(164,'English services Page  Template improve your bussniess component','{\"_method\":\"PATCH\",\"_token\":\"xUUBqQR9L1S5YTZuHnvzqBNYCosfWPJ5TnyRGqaV\",\"component_template_id\":\"92\",\"name\":\"English services Page  Template improve your bussniess component\",\"title1\":\"IMPROVE YOUR BUSINESS\",\"title2\":\"Let\\u2019s discuss how we can help you.\",\"title_btn\":\"Contact us\",\"link\":\"\\/#\",\"file1\":\"imp.jpg\",\"website_id\":\"2\",\"published\":1,\"component_data\":\"\"}',92,0,2,3,1,NULL,'2017-08-15 11:17:13','2017-08-15 11:33:53',''),(165,'English software  component p_left_image_second','{\"_token\":\"xUUBqQR9L1S5YTZuHnvzqBNYCosfWPJ5TnyRGqaV\",\"component_template_id\":\"106\",\"name\":\"English software  component p_left_image_second\",\"title1\":\"SPEED LIMITER\",\"description\":\"The speed limiter option makes it possible to operate in worksites and countries where speed limitations are imposed. It automatically regulates maximum speed and removes the possibility for the operator to increase the speed and exceed the limit.  Available for Articulated Haulers and Wheel Loaders.  For more information about Speed limiter, contact your local Volvo dealer.\",\"title2\":\"INCREASED SAFETY\",\"published\":1,\"website_id\":\"2\",\"file_1\":\"left2.jpg\"}',106,0,2,3,1,NULL,'2017-08-15 11:21:54','2017-08-15 11:21:54',''),(166,'English inspection Page main_image','{\"_token\":\"xUUBqQR9L1S5YTZuHnvzqBNYCosfWPJ5TnyRGqaV\",\"component_template_id\":\"88\",\"name\":\"English inspection Page main_image\",\"title1\":\"VOLVO INSPECTION PROGRAMS\",\"title2\":\"VALUABLE INFORMATION\",\"published\":1,\"website_id\":\"2\",\"file1\":\"ins.jpg\"}',88,0,2,3,1,NULL,'2017-08-15 11:42:33','2017-08-15 11:42:33',''),(167,'English inspection page head_title','{\"_token\":\"xUUBqQR9L1S5YTZuHnvzqBNYCosfWPJ5TnyRGqaV\",\"component_template_id\":\"70\",\"name\":\"English inspection page head_title\",\"title1\":\"VOLVO INSPECTION PROGRAMS\",\"title2\":\"Volvo offers a wide range of inspection services to ensure customers\\u2019 productivity and uptime. Inspecting your machine regularly will prevent any unscheduled downtime so that you can rely on your Volvo machine to keep working.  Whether you choose to have a wear inspection or oil analysis, all inspection programs contribute to maximum uptime.\",\"published\":1,\"website_id\":\"2\"}',70,0,2,3,1,NULL,'2017-08-15 11:43:32','2017-08-15 11:43:32',''),(168,'English inspection component p_right_image_first','{\"_token\":\"xUUBqQR9L1S5YTZuHnvzqBNYCosfWPJ5TnyRGqaV\",\"component_template_id\":\"103\",\"name\":\"English inspection component p_right_image_first\",\"title1\":\"WEAR INSPECTION PROGRAMS\",\"description\":\"The status of the undercarriage is vital for the reliability and productivity of the excavator. Wear parts in poor condition can shorten the machine\\u2019s life and increase the risk of unplanned downtime and maintenance cost.   Let your Volvo dealer carry out a wear inspection on a regular basis. This way you can determine when to replace components for lowest operating cost.   Extend life and productivity of the undercarriage Your Volvo technician will take and record measurements to accurately inspect wear.   Monitor wear data  All inspection measurements are saved and monitored through our advanced software.\",\"title2\":\"REGULAR INSPECTIONS\",\"published\":1,\"website_id\":\"2\",\"file_1\":\"rrr.jpg\"}',103,0,2,3,1,NULL,'2017-08-15 11:44:59','2017-08-15 11:44:59',''),(169,'English inspection p_left_image_first','{\"_token\":\"xUUBqQR9L1S5YTZuHnvzqBNYCosfWPJ5TnyRGqaV\",\"component_template_id\":\"105\",\"name\":\"English inspection p_left_image_first\",\"title1\":\"OIL ANALYSIS\",\"description\":\"With regular use of Volvo oil analysis you get a comprehensive diagnosis of the machine\'s condition. The analysis gives a lot of information, e.g., water\\/coolant content, viscosity, dirt and quantity of metal particles.  Thanks to the early warnings provided by the oil analysis you can plan component changes in good time before problems occur, thus avoiding expensive damage and downtime.  With Volvo oil analysis you get:  Reduced operating costs An excellent planning tool for preventive maintenance Less downtime Using the oil analysis program can also shorten repair times, since sometimes it can pinpoint the cause of the malfunction. This means much faster troubleshooting and diagnosis. For more information about Volvo Oil analysis, please contact your Volvo dealer.\",\"title2\":\"ANALYSE FOR BETTER PLANNING\",\"published\":1,\"website_id\":\"2\",\"file_1\":\"llll.jpg\"}',105,0,2,3,1,NULL,'2017-08-15 11:46:09','2017-08-15 11:46:09',''),(170,'English inspection improve your business','{\"_token\":\"xUUBqQR9L1S5YTZuHnvzqBNYCosfWPJ5TnyRGqaV\",\"component_template_id\":\"92\",\"name\":\"English inspection improve your business\",\"title1\":\"IMPROVE YOUR BUSINESS\",\"title2\":\"Let\\u2019s discuss how we can help you.\",\"title_btn\":\"Contact us\",\"link\":\"\\/#\",\"published\":1,\"website_id\":\"2\",\"file1\":\"imp.jpg\"}',92,0,2,3,1,NULL,'2017-08-15 11:48:42','2017-08-15 11:48:42',''),(171,'English certified-refurbishment main_image ','{\"_method\":\"PATCH\",\"_token\":\"xUUBqQR9L1S5YTZuHnvzqBNYCosfWPJ5TnyRGqaV\",\"component_template_id\":\"88\",\"name\":\"English certified-refurbishment main_image \",\"title1\":\"VOLVO CERTIFIED REBUILD PROGRAM\",\"title2\":\"EXTEND THE LIFE OF YOUR VOLVO\",\"website_id\":\"2\",\"published\":1,\"file1\":\"u8.jpg\",\"component_data\":\"\"}',88,0,2,3,1,NULL,'2017-08-15 12:01:22','2017-08-15 12:05:20',''),(172,'English certified-refurbishment head_title','{\"_method\":\"PATCH\",\"_token\":\"xUUBqQR9L1S5YTZuHnvzqBNYCosfWPJ5TnyRGqaV\",\"component_template_id\":\"70\",\"name\":\"English certified-refurbishment head_title\",\"title1\":\"WHY REPLACE WHEN YOU CAN REBUILD?\",\"title2\":\"Volvo Certified Rebuild Program optimizes your budget and the long-term value of your investment.  Give your hardworking equipment the makeover it deserves while protecting your finances and the environment.By restoring your existing asset, Volvo Certified Rebuild Program optimizes your budget and the long-term value of your investment.  Rediscover the strength, durability and power built-in to your Volvo machine.  A fraction of the cost of a new machine\",\"website_id\":\"2\",\"published\":1,\"component_data\":\"\"}',70,0,2,3,1,NULL,'2017-08-15 12:02:11','2017-08-15 12:04:12',''),(173,'English certified-refurbishment p_left_image_first','{\"_token\":\"xUUBqQR9L1S5YTZuHnvzqBNYCosfWPJ5TnyRGqaV\",\"