e\",\"title1\":\"FLEET MANAGEMENT MADE EASY\",\"title2\":\"CareTrack is the Volvo Construction Equipment telematics system. It gives you access to a wide range of machine monitoring information, saving you time and money. With CareTrack you can reduce fuel costs, optimize machine and operator performance, and proactively manage service and maintenance to maximize uptime.\",\"published\":1,\"website_id\":\"2\"}',70,0,2,3,1,NULL,'2017-08-15 12:56:44','2017-08-15 12:56:44',''),(179,'English telematic Page p_right_image_first','{\"_token\":\"xUUBqQR9L1S5YTZuHnvzqBNYCosfWPJ5TnyRGqaV\",\"component_template_id\":\"103\",\"name\":\"English telematic Page p_right_image_first\",\"title1\":\"CARETRACK\",\"description\":\"Operation reports allow you to monitor idle time \\u2013 information that gives you the power to reduce fuel consumption, non-productive machine hours and service costs.\",\"title2\":\"SAVE MONEY\",\"published\":1,\"website_id\":\"2\",\"file_1\":\"re.jpg\"}',103,0,2,3,1,NULL,'2017-08-15 12:58:55','2017-08-15 12:58:55',''),(180,'English telematic Page p_left_image_first','{\"_token\":\"xUUBqQR9L1S5YTZuHnvzqBNYCosfWPJ5TnyRGqaV\",\"component_template_id\":\"105\",\"name\":\"English telematic Page p_left_image_first\",\"title1\":\"  \",\"description\":\"Proactively manage your machines and increase uptime by planning service and maintenance requirements in advance, avoiding potential problems. It\'s also possible for your local Volvo dealer to troubleshoot faults remotely \\u2013 minimizing service and down time.\",\"title2\":\"SAVE TIME\",\"published\":1,\"website_id\":\"2\",\"file_1\":\"lee.jpg\"}',105,0,2,3,1,NULL,'2017-08-15 13:00:18','2017-08-15 13:00:18',''),(181,'English telematic Page p_right_image_second','{\"_token\":\"xUUBqQR9L1S5YTZuHnvzqBNYCosfWPJ5TnyRGqaV\",\"component_template_id\":\"104\",\"name\":\"English telematic Page p_right_image_second\",\"title1\":\"  \",\"description\":\"From fuel consumption data to location and machine usage reports, CareTrack gives you access to a wealth of information \\u2013 allowing you to take actions that will have a noticeable impact on your business. Discover specific functionalities to unlock further savings and get the most out of your machine.\",\"title2\":\"INFINITE OPPORTUNITIES\",\"published\":1,\"website_id\":\"2\",\"file_1\":\"io.jpg\"}',104,0,2,3,1,NULL,'2017-08-15 13:02:08','2017-08-15 13:02:08',''),(182,'English telematic Page p_left_image_second','{\"_token\":\"xUUBqQR9L1S5YTZuHnvzqBNYCosfWPJ5TnyRGqaV\",\"component_template_id\":\"106\",\"name\":\"English telematic Page p_left_image_second\",\"title1\":\"CARETRACK PACKAGES\",\"description\":\"CareTrack is divided into eight packages, each offering specific features designed to enhance your business.  CareTrack standard Access machine hours and location and manage service plans and wear parts via the web portal. Tracking and status Notifications tell you when a machine goes outside pre-set location and time boundaries. A status report supplies fuel level, machine location and machine hours. Operation Reports highlight how each machine is used and if operators are working efficiently. Production On Board Weighing technology shows a machine\\u2019s true productivity. Accessible information \\u2013 including load efficiency and number of cycles \\u2013 reduce fuel consumption and improve component life. Anti-theft Volvo crawler excavators can be fitted with an antitheft tracking system. Communication Satellite communication is provided in areas where no\\/weak cell phone connection is available. API API enables CareTrack data to be incorporated into your management system.\",\"title2\":\"THE RIGHT FEATURES FOR YOUR BUSINESS\",\"published\":1,\"website_id\":\"2\",\"file_1\":\"ta.jpg\"}',106,0,2,3,1,NULL,'2017-08-15 13:03:56','2017-08-15 13:03:56',''),(183,'English telematic Page video','{\"_token\":\"xUUBqQR9L1S5YTZuHnvzqBNYCosfWPJ5TnyRGqaV\",\"component_template_id\":\"107\",\"name\":\"English telematic Page video\"