d or older, Volvo CE offers extensively renovated components that have been carefully cleaned and tested for quality and reliability.  Exchange Services Diesel particulate filters (DPF) are the first components to be included in our Exchange Service program. Blocked filters can be traded for a Volvo Reman filter that has been rigorously tested to ensure it offers at least 95% of the capacity of a brand new filter, but at a fraction of the cost. Keep your machine a Volvo and care for the environment by giving new life to old components. \",\"title2\":\"REMANUFACTURING SERVICES\",\"published\":1,\"website_id\":\"2\",\"file_1\":\"tt.jpg\"}',105,0,2,3,1,NULL,'2017-08-20 06:29:54','2017-08-20 06:29:54',''),(213,'English repair parts  video  agian ','{\"_token\":\"KXJbactVWZaR61eqPvsvDNPVG9KDyiyo0i14XHpj\",\"component_template_id\":\"114\",\"name\":\"English repair parts  video  agian \",\"video_id\":\"HcofYYG-Xus\",\"published\":1,\"website_id\":\"2\"}',114,0,2,3,1,NULL,'2017-08-20 06:32:09','2017-08-20 06:32:09',''),(214,'English repair parts  title_desc','{\"_token\":\"KXJbactVWZaR61eqPvsvDNPVG9KDyiyo0i14XHpj\",\"component_template_id\":\"115\",\"name\":\"English repair parts  title_desc\",\"title1\":\"VOLVO REMAN\",\"title2\":\"Give your machine a second life! Discover the benefits of Volvo Reman - Remanufacturing Services.\",\"published\":1,\"website_id\":\"2\"}',115,0,2,3,1,NULL,'2017-08-20 06:54:25','2017-08-20 06:54:25',''),(215,'English repair parts  make a request','{\"_token\":\"KXJbactVWZaR61eqPvsvDNPVG9KDyiyo0i14XHpj\",\"component_template_id\":\"92\",\"name\":\"English repair parts  make a request\",\"title1\":\"Know what you need?\",\"title2\":\"Want to order parts? We will be happy to help you.\",\"title_btn\":\"Make a  request\",\"link\":\"\\/#\",\"published\":1,\"website_id\":\"2\",\"file1\":\"imp.jpg\"}',92,0,2,3,1,NULL,'2017-08-20 06:59:57','2017-08-20 06:59:57',''),(216,'English maintenance-parts page main_ image','{\"_method\":\"PATCH\",\"_token\":\"