8:48:03','2017-08-20 08:48:03',''),(225,'English maintenance-parts page p_left_image_second','{\"_token\":\"KXJbactVWZaR61eqPvsvDNPVG9KDyiyo0i14XHpj\",\"component_template_id\":\"106\",\"name\":\"English maintenance-parts page p_left_image_second\",\"title1\":\"VOLVO GENUINE BATTERIES\",\"description\":\"Genuine Volvo Batteries from Volvo Construction Equipment have enough power to meet and exceed your needs in order to cope with truly demanding situations and conditions.  Starting power  The unique design of the battery cell separators helps to reduce voltage drop under load, producing over 25% more starting power than alternative starter batteries.  Recharges rapidly The same special lead-calcium alloy allows the battery to reach optimum power in less time compared to alternative batteries.  Long-lasting On average, a Volvo Genuine battery will have 20% longer service life than other batteries.  Safe to handle The housing of a Volvo Genuine Battery is extremely strong and 100 % leak resistant under normal usage conditions.  Environmental awareness The production of a Volvo Genuine Battery is carried out with the utmost consideration to reduce impact on the environment.\",\"title2\":\"THE POWER TO MEET YOUR NEEDS\",\"published\":1,\"website_id\":\"2\",\"file_1\":\"uuu.jpg\"}',106,0,2,3,1,NULL,'2017-08-20 09:02:30','2017-08-20 09:02:30',''),(226,'English maintenance-parts page head_title improve your busniess ','{\"_token\":\"KXJbactVWZaR61eqPvsvDNPVG9KDyiyo0i14XHpj\",\"component_template_id\":\"92\",\"name\":\"English maintenance-parts page head_title improve your busniess \",\"title1\":\"Know what you need?\",\"title2\":\"Want to order parts? We will be happy to help you.\",\"title_btn\":\"Make a  request\",\"link\":\"\\/#\",\"published\":1,\"website_id\":\"2\",\"file1\":\"imp.jpg\"}',92,0,2,3,1,NULL,'2017-08-20 09:05:26','2017-08-20 09:05:26',''),(227,'English wear parts main_image','{\"_token\":\"KXJbactVWZaR61eqPvsvDNPVG9KDyiyo0i14XHpj\",\"component_template_id\":\"88\",\"name\":\"English wear parts main_image\",\"title1\":\"Genuine Volvo wear parts\",\"title2\":\"A range of parts for your application\",\"published\":1,\"website_id\":\"2\",\"file1\":\"ko.jpg\"}',88,0,2,3,1,NULL,'2017-08-20 09:59:07','2017-08-20 09:59:07',''),(228,'English wear parts head_title','{\"_token\":\"KXJbactVWZaR61eqPvsvDNPVG9KDyiyo0i14XHpj\",\"component_template_id\":\"70\",\"name\":\"English wear parts head_title\",\"title1\":\"GENUINE VOLVO WEAR PARTS\",\"title2\":\"Volvo offers a full range of genuine wear parts, developed and tested to ensure that they live up to your highest expectations for all applications. To keep your machine in prime condition, Volvo offers parts to keep it running smoothly for as long as possible.  Choose from wear parts such as undercarriage parts, Volvo hoses or Volvo Tooth System to keep your machine running like new. These parts have been subjected to the toughest tests to be able to withstand extreme stresses. Our design and choice of material guarantees superior performance.\",\"published\":1,\"website_id\":\"2\"}',70,0,2,3,1,NULL,'2017-08-20 09:59:51','2017-08-20 09:59:51',''),(229,'English wear parts video','{\"_token\":\"KXJbactVWZaR61eqPvsvDNPVG9KDyiyo0i14XHpj\",\"component_template_id\":\"107\",\"name\":\"English wear parts video\",\"video_id\":\"rQpC6Zv2uq4\",\"published\":1,\"website_id\":\"2\"}',107,0,2,3,1,NULL,'2017-08-20 10:01:44','2017-08-20 10:01:44',''),(230,'English wear parts head_title_lower','{\"_token\":\"KXJbactVWZaR61eqPvsvDNPVG9KDyiyo0i14XHpj\",\"component_template_id\":\"108\",\"name\":\"English wear parts head_title_lower\",\"title1\":\"CUSTOMER SOLUTIONS\",\"title2\":\"An overview of the products and services we offer to support your business throughout your ownership \\u2013 helping you stay profitable year after year.\",\"published\":1,\"website_id\":\"2\"}',108,0,2,3,1,NULL,'2017-08-20 10:02:23','2017-08-20 10:02:23',''),(231,'English wear parts p_right_image_first','{\"_token\":\"KXJbactVWZaR61eqPvsvDNPVG9KDyiyo0i14XHpj\",\"component_template_id\":\"103\",\"name\":\"English wear parts p_right_image_first\",\"title1\":\"VOLVO TOOTH SYSTEM\",\"description\":\"Volvo Tooth System gives you optimized long change intervals, high productivity and profitability.  Volvo offers specialized patented teeth and adapters for all types of applications. High quality parts lower your total cost of ownership and maximize the performance of your machine.  Easy to fit The vertical locking device makes mounting and removing fast and easy. It is completely integrated in the adapter body for protection and longer service life.  Volvo teeth withstand high stress levels A perfect fit between the tooth and adapter, together with large stabilizing surfaces, provides a very strong unit to withstand high levels of force and stress.  Self-sharpening The self-sharpening design and strategically placed wear material give maximum wear life, with maintained performance.  Resistant to forces The edge of the adapters and teeth have an acute angle that gives perfect resistance to frontal forces and reduces the risk of \\u201ctooth box\\u201d opening.\",\"title2\":\"MAKE IT LAST\",\"published\":1,\"website_id\":\"2\",\"file_1\":\"lk.jpg\"}',103,0,2,3,1,NULL,'2017-08-20 10:04:45','2017-08-20 10:04:45',''),(232,'English wear parts p_left_image_first','{\"_token\":\"KXJbactVWZaR61eqPvsvDNPVG9KDyiyo0i14XHpj\",\"component_template_id\":\"105\",\"name\":\"English wear parts p_left_image_first\",\"title1\":\"GENUINE VOLVO UNDERCARRIAGE PARTS\",\"description\":\"Volvo\\u2019s full range of undercarriage parts are developed and tested to ensure the highest standard of quality and performance.  Pushed to the limit The undercarriage parts are subjected to extensive testing to be able to withstand extreme consistent stresses.  Designed specifically for Volvo Construction Equipment Volvo undercarriage parts give you a safe and effective operation, a long productive service life and low operating costs.  Volvo Rubber Tracks  Developed in conjunction with Volvo construction machines Meet the highest standards of safety and quality\",\"title2\":\"LIVING UP TO YOUR HIGHEST EXPECTATIONS\",\"published\":1,\"website_id\":\"2\",\"file_1\":\"po.jpg\"}',105,0,2,3,1,NULL,'2017-08-20 10:06:41','2017-08-20 10:06:41',''),(233,'English wear parts video_parts','{\"_token\":\"KXJbactVWZaR61eqPvsvDNPVG9KDyiyo0i14XHpj\",\"component_template_id\":\"114\",\"name\":\"English wear parts video_parts\",\"video_id\":\"rBsfNDYlv6o\",\"published\":1,\"website_id\":\"2\"}',114,0,2,3,1,NULL,'2017-08-20 10:07:30','2017-08-20 10:07:30',''),(234,'English wear parts title_desc parts','{\"_token\":\"KXJbactVWZaR61eqPvsvDNPVG9KDyiyo0i14XHpj\",\"component_template_id\":\"115\",\"name\":\"English wear parts title_desc parts\",\"title1\":\"VOLVO UNDERCARRIAGE PARTS\",\"title2\":\"Find out the results of extreme testing of Volvo Track Chains and Bottom Rollers! Volvo Undercarriage Parts deliver the quality and durability you can rely on.\",\"published\":1,\"website_id\":\"2\"}',115,0,2,3,1,NULL,'2017-08-20 10:09:04','2017-08-20 10:09:04',''),(235,'English wear parts p_right_image_second_with_link','{\"_method\":\"PATCH\",\"_token\":\"KXJbactVWZaR61eqPvsvDNPVG9KDyiyo0i14XHpj\",\"component_template_id\":\"116\",\"name\":\"English wear parts p_right_image_second_with_link\",\"file_1\":\"to.jpg\",\"title1\":\"VOLVO RUBBER PAD BOLT-ON\",\"description\":\"The Volvo Rubber pad bolt-on system for tracked excavators is the perfect solution for increasing machine versatility. The cost effective design allows you to easily switch between on and off-road locations without causing surface damage.  Versatility Switch between on and off-road jobs and benefit from two machines in one. The rubber pads provide full ground surface protection and are easily removed when full traction is needed.  High durability Made from a robust rubber blend to reduce wear, the pad incorporates a steel plate with a durable rubber exterior and a rubber cushion which helps to decrease vibration and noise.  Availability The rubber pad system is available both as a factory-fit option and through the Volvo dealer network. The aftermarket kit provides both the pad and track shoe.  Cost efficiency Replacing single rubber pads as and when is necessary is a cost efficient and easy way to maintain an excavator\\u2019s track system.\",\"title2\":\"volvo rubber pad bolt on system INCREASE YOUR VERSATILITY\",\"title_link\":\" Download the flyer (PDF, 277KB)\",\"website_id\":\"2\",\"published\":1,\"file_2\":\"flyer.pdf\",\"component_data\":\"\"}',116,0,2,3,1,NULL,'2017-08-20 10:14:20','2017-08-20 11:11:24',''),(236,'English wear parts p_right_image_second','{\"_token\":\"KXJbactVWZaR61eqPvsvDNPVG9KDyiyo0i14XHpj\",\"component_template_id\":\"104\",\"name\":\"English wear parts p_right_image_second\",\"title1\":\"VOLVO EXPANDER BOLTS\",\"description\":\"The perfect solution when wear in your construction equipment causes play in the attaching points and the holes are worn.  A permanent solution for an economic and long-lasting life When your machine starts to show signs of wear, Volvo expander bolts are the perfect solution.  Fast and easy installation (often on site) Volvo expander bolts feature two expanding sleeves that fill the gap and connect the attaching eyes.  With Volvo expander bolts no reconditioning or machine reworking is needed.  Available for a wide range of products.\",\"title2\":\"A SOLUTION FOR WEAR \",\"published\":1,\"website_id\":\"2\",\"file_1\":\"hy.jpg\"}',104,0,2,3,1,NULL,'2017-08-20 10:16:55','2017-08-20 10:16:55',''),(237,'English wear parts video_parts2','{\"_token\":\"KXJbactVWZaR61eqPvsvDNPVG9KDyiyo0i14XHpj\",\"component_template_id\":\"117\",\"name\":\"English wear parts video_parts2\",\"video_id\":\"3N2Mz79uB8c\",\"published\":1,\"website_id\":\"2\"}',117,0,2,3,1,NULL,'2017-08-20 10:18:41','2017-08-20 10:18:41',''),(238,'English repair parts  title_desc2','{\"_token\":\"KXJbactVWZaR61eqPvsvDNPVG9KDyiyo0i14XHpj\",\"component_template_id\":\"118\",\"name\":\"English repair parts  title_desc2\",\"title1\":\"EVERY PART IS VITAL!\",\"title2\":\"The better the quality of your components, the more you get from your Volvo machine. Every part is vital for uptime and performance. So why take a risk?\",\"published\":1,\"website_id\":\"2\"}',118,0,2,3,1,NULL,'2017-08-20 10:20:05','2017-08-20 10:20:05',''),(239,'English wear parts improve your business ','{\"_method\":\"PATCH\",\"_token\":\"KXJbactVWZaR61eqPvsvDNPVG9KDyiyo0i14XHpj\",\"component_template_id\":\"92\",\"name\":\"English wear parts improve your business \",\"title1\":\"Know what you need?\",\"title2\":\"Want to order parts? We will be happy to help you.\",\"title_btn\":\"Make a  request\",\"link\":\"\\/#\",\"file1\":\"imp.jpg\",\"website_id\":\"2\",\"published\":1,\"component_data\":\"\"}',92,0,2,3,1,NULL,'2017-08-20 10:21:21','2017-08-20 10:34:30','');
