 EXCAVATORS ECR28, ECR38, ECR58PLUS AND ECR88PLUS PRESENTATION','','Short presentation of the Volvo Construction Equipment Compact Excavators ECR28C, ECR38C, ECR48C, ECR58+ and ECR88+.','','','',0,''),(16,'COMPACT EXCAVATOR EC55B PRO','EC55B PRO','','','ec55bpro-small.jpg','ec55bpro-big.jpg',16,2,1,2,'2017-08-21 15:37:22','2017-08-21 13:19:21','0000-00-00 00:00:00','ec55b_pro','','A STURDY DESIGN','','SAFETY IS ALWAYS A TOP PRIORITY','','When it comes to your safety, Volvo never compromises. The EC55B Pro compact excavator offers exactly what you need to stay safe, so you can concentrate on getting the job done. And each model is robustly built, to stand up to even the most punishing jobsite conditions.','ec55b_pro.pdf','0','','','','','','',0,''),(17,'COMPACT EXCAVATOR ECR35D','ECR35D','','','ecr35d-small.jpg','ecr35d-big.jpg',16,2,1,2,'2017-08-21 15:38:36','2017-08-21 13:21:46','0000-00-00 00:00:00','ecr35d','','PACKED WITH PERFORMANCE','','A WINNING COMBINATION','','Perform with precision in the Volvo ECR35D compact excavator, featuring a comfortable cab, all-around visibility and advanced, easy-to-use controls to optimize operator productivity. Access tight job sites without compromising safety in the cleverly designed machine, equipped with a long list of standard features for efficient operations and long-lasting performance.','ecr35d_ecr40d.pdf','0','VOLVO EC35D/ECR35D/ECR40D: CONTROL IN COMFORT','','Stay cool, calm and in control in the spacious EC35D/ECR35D/ECR40D Volvo cab. Offering all-around visibility, ergonomically-positioned controls and a multi-adjustable seat and console, it\'s no wonder the Volvo cab is an industry leader. Quickly access most machine functions and settings using the on-board keypad and monitor for greater ease of operation and productivity.','','','',0,''),(18,'COMPACT EXCAVATOR EC35D','EC35D','','','ec35d-small.jpg','ec35d-big.jpg',16,2,1,2,'2017-08-21 15:38:19','2017-08-21 13:32:47','0000-00-00 00:00:00','ec35d','','DO MORE FOR LESS','','PRECISE PERFORMANCE','','Do more for less in the Volvo EC35D compact excavator, designed to work with power and precision in tight spaces. Based on a proven design, the EC35D delivers high levels of comfort, performance and versatility, enabling you to be more productive in a range of applications.','ec35d.pdf','0','','','','','','',0,''),(19,'COMPACT EXCAVATOR EC27D','EC27D','','','ec27d-small.jpg','ec27d-big.jpg',16,2,1,2,'2017-08-21 15:46:36','2017-08-21 13:45:29','0000-00-00 00:00:00','ec27d','','EC27D COMPACT EXCAVATOR: YOUR PARTNER FOR THE LONG STRETCH','','DO MORE, EVERYWHERE','','Count on the Volvo EC27D compact excavator for best-in-class performance. With impressive lifting capacities and excellent digging forces, this rock-solid machine can handle a variety of jobs. Combining durability and ease of operation with serviceability and versatility, the EC27D is designed to stretch further, dig deeper and reach higher.','ec27d.pdf','vSpo2I2NaFs','VOLVO EC27D COMPACT EXCAVATOR: ULTIMATE PERFORMANCE','','Stretch further, dig deeper and reach higher with the EC27D.Based on a proven design, this compact excavator is built to perform and boost profitability. Combining intuitive operation and operator comfort with simple serviceability, this machine provides all the strength and versatility you need – because big jobs demand big performance.','','','',0,''),(20,'WHEELED EXCAVATOR EW205D','EW205D','','','ew205d-sm.jpg','ew205d-big.jpg',17,2,1,2,'2017-08-21 14:13:23','2017-08-21 14:13:23','0000-00-00 00:00:00','ew205d','','ACCESS MORE UPTIME','','','','','ew205d.pdf','GRjAU0MGSsE','VOLVO EW205D WHEELED EXCAVATOR PROMOTIONAL VIDEO','','Discover the features and benefits of the new EW205D wheeled excavator!','','','',0,''),(21,'WHEELED EXCAVATOR EW145B PRIME','EW145B Prime','','','volvo-find-wheeled-excavator-ew145b-prime-t3-walkaround-sm.jpg','volvo-show-wheeled-excavator-ew145b-prime-t3-star-picture-big.jpg',17,2,1,2,'2017-08-21 14:15:23','2017-08-21 14:15:23','0000-00-00 00:00:00','ew145b_prime','','A ONE-MACHINE FLEET','','','','','ew145b.pdf','fX9NxTG39X0','SPIRIT MAGAZINE: CULTIVATING COMMUNITIES','','CHINA: Volvo excavators help battle the elements and strengthen a growing agricultural community','','','',0,''),(22,'CRAWLER EXCAVATOR EC950E','EC950E','','','volvo-find-crawler-excavator-ec950e-t2-t3-sm.jpg','volvo-show-crawler-excavator-ec950e-t2-big.jpg',18,2,1,2,'2017-08-21 14:18:08','2017-08-21 14:18:08','0000-00-00 00:00:00','ec950e','','BIGGER IS BETTER','','TACKLE TOUGH TASKS WITH EASE','','Perform a variety of tasks with greater speed in Volvo’s heavy-duty EC950E, utilizing advanced technology to increase productivity and efficiency. Whether you’re working on a quarry, in mass excavation or any other application, the big and powerful EC950E excavator and Volvo’s durable wear-resistant components will maximize your profitability and uptime.','ec950e.pdf','qzUTO4Xz3h0','VOLVO EC950E CRAWLER EXCAVATOR: PEAK PERFORMANCE','','Job done. With the big and powerful EC950E, no task is too tough. Increase profitability with superior digging force, quick cycle times and outstanding fuel efficiency for a maximum return on investment.','','','',0,''),(23,'CRAWLER EXCAVATOR EC750D','EC750D','','','volvo-find-crawler-excavator-ec750d-t3-walkaround-sm.jpg','volvo-show-crawler-excavator-ec750d-t3-star-picture-big.jpg',18,2,1,2,'2017-08-21 14:21:00','2017-08-21 14:21:00','0000-00-00 00:00:00','ec750d','','TOUGH IT OUT','','DEMONSTRATE YOUR POWER','','For ultimate performance and low fuel consumption, the EC750D crawler excavator gets the job done whether you’re working at a mine, quarry or in heavy construction applications. The machine’s engine delivers increased horsepower and fuel efficiency, while its electro hydraulic system provides excellent control for faster cycle times.','ec750d.pdf','iA00ZYVeg-A','VOLVO EC750D CRAWLER EXCAVATOR PROMOTIONAL VIDEO','','For ultimate performance and low fuel consumption, Volvo EC750D gets the job done whether you’re working at a mine, quarry or in heavy construction applications.','','','',0,''),(24,'CRAWLER EXCAVATOR EC480D','EC480D','','','volvo-find-crawler-excavator-ec480d-t2-walkaround-sm.jpg','volvo-show-crawler-excavator-ec480d-t2-star-picture-2324x1200.jpg',18,2,1,2,'2017-08-21 14:52:36','2017-08-21 14:52:36','0000-00-00 00:00:00','ec480d','','HAVE IT ALL','','','','Get productive with Volvo’s EC480D crawler excavator. These machines perform with greater digging force and shorter cycle times and feature increased engine power and improved hydraulics. Sustain optimum power and productivity day in and day out with Volvo.','ec480d.pdf','HN2vMXAxUhQ','VOLVO D-SERIES SERIES CRAWLER EXCAVATORS LAUNCH VIDEO (LRM)','','Leave the big jobs to the heavy equipment machines you can rely on. Get top hydraulic excavator performance from the Volvo D-series excavators. Bring on the heavy-duty applications in a wide range of demanding conditions, including mining, quarry work, civil construction, mass excavation, hauler truck loading, trenching, large-scale road building, pipe lifting and more. The Volvo D-series excavators help you to handle more tons per hour, large buckets, smooth control, leading fuel efficiency and all-day comfortable operation.','','','',0,''),(25,'CRAWLER EXCAVATOR EC380D','EC380D','','','volvo-find-crawler-excavator-ec380d-t2-walkaround-1000x1000.jpg','volvo-show-crawler-excavator-ec380d-t2-star-picture-2324x1200.jpg',18,2,1,2,'2017-08-21 14:54:54','2017-08-21 14:54:54','0000-00-00 00:00:00','ec380d','','HAVE IT ALL','','CAPITALIZE ON EFFICIENCY','','Get productive with Volvo’s EC380D crawler excavator. Featuring increased engine power and improved hydraulics, these machines perform with greater digging force and shorter cycle times. Sustain optimum power and productivity day in and day out with Volvo.\r\n\r\n','ec380d.pdf','HN2vMXAxUhQ','VOLVO D-SERIES SERIES CRAWLER EXCAVATORS LAUNCH VIDEO (LRM)','','Leave the big jobs to the heavy equipment machines you can rely on. Get top hydraulic excavator performance from the Volvo D-series excavators. Bring on the heavy-duty applications in a wide range of demanding conditions, including mining, quarry work, civil construction, mass excavation, hauler truck loading, trenching, large-scale road building, pipe lifting and more. The Volvo D-series excavators help you to handle more tons per hour, large buckets, smooth control, leading fuel efficiency and all-day comfortable operation.\r\n\r\n','','','',0,''),(26,'CRAWLER EXCAVATOR EC350D','EC350D','','','volvo-find-crawler-excavator-ec350d-t2-walkaround-1000x1000.jpg','volvo-show-crawler-excavator-ec350d-t2-star-picture-2324x1200.jpg',18,2,1,2,'2017-08-21 14:56:45','2017-08-21 14:56:45','0000-00-00 00:00:00','ec350d','','POWER UNLEASHED','','THE BEST MACHINE FOR THE JOB','','Introducing the EC350D crawler excavator from Volvo – a powerful production machine designed to boost performance. State-of-the-art technology including Volvo’s unique ECO mode, new electro-hydraulic system and fuel efficient D8 engine ensures this machine delivers fast cycle times, high digging power and low fuel consumption.\r\n\r\n','ec350d.pdf','','','','','','','',0,''),(27,'CRAWLER EXCAVATOR EC300D','EC300D','','','volvo-find-crawler-excavator-ec300d-t2-walkaround-1000x1000.jpg','volvo-show-crawler-excavator-ec300d-t2-star-picture-2324x1200.jpg',18,2,1,2,'2017-08-21 14:58:57','2017-08-21 14:58:57','0000-00-00 00:00:00','ec300d','','QUALITY FEATURES','','GET THE MOST FOR YOUR EXCAVATOR','','Volvo\'s EC300D crawler excavator is built to increase production, reduce fuel consumption and reach new levels of efficiency. With proven, advanced technology the EC300D offers customers a 7% - 10% increase in fuel efficiency compared to the previous model.\r\n\r\n','ec300d.pdf','','','','','','','',0,''),(28,'CRAWLER EXCAVATOR EC250D','EC250D','','','volvo-find-crawler-excavator-ec250d-t2-walkaround-1000x1000.jpg','volvo-show-crawler-excavator-ec250d-t2-star-picture-2324x1200.jpg',18,2,1,2,'2017-08-21 15:01:04','2017-08-21 15:01:04','0000-00-00 00:00:00','ec250d','','QUALITY FEATURES','','POWERFUL PERFORMANCE','','With faster cycle times and greater productivity, the Volvo EC250D crawler excavator will help you to get the job done faster. Whether you work in the quarry, road construction, site preparation or any other application, you’ll experience high performance from these powerful machines.\r\n\r\n','ec250d.pdf','VMak6o3cTWs','SPIRIT MAGAZINE: PEAK PERFORMANCE','','ITALY: Thanks to some cool high-level work from Volvo excavators, skiers and snowboarders in Italy faced an exciting new challenge this winter\r\n\r\n','','','',0,''),(29,'CRAWLER EXCAVATOR EC220D','EC220D','','','volvo-find-crawler-excavator-ec220d-t2-walkaround-1000x1000.jpg','volvo-show-crawler-excavator-ec220d-t2-star-picture-2324x1200.jpg',18,2,1,2,'2017-08-21 15:03:20','2017-08-21 15:03:20','0000-00-00 00:00:00','ec220d','','QUALITY DESIGN','','DESIGNED FOR PRODUCTIVITY','','The Volvo EC220D crawler excavator boasts a 10% improvement in fuel efficiency compared to the previous model. With Volvo’s unique ECO mode, a new hydraulic system and a premium Volvo D6 diesel engine, you’ll soon start to reap the benefits of reduced operational costs. Maximize your fuel efficiency with Volvo.\r\n\r\n','ec220d.pdf','VMak6o3cTWs','SPIRIT MAGAZINE: PEAK PERFORMANCE','','ITALY: Thanks to some cool high-level work from Volvo excavators, skiers and snowboarders in Italy faced an exciting new challenge this winter','','','',0,''),(30,'CRAWLER EXCAVATOR EC210B PRIME','EC210B Prime','','','volvo-find-crawler-excavator-ec210b-prime-t2-walkaround-1000x1000.jpg','volvo-show-crawler-excavator-ec210b-t2-star-picture-2324x1200.jpg',18,2,1,2,'2017-08-21 15:05:47','2017-08-21 15:05:47','0000-00-00 00:00:00','ec210b_prime','','GO GET IT WITH VOLVO','','A TRUSTED PARTNER','','Trust. It’s the foundation of any relationship – especially the one you have with your machine. That’s why the Volvo EC210B prime crawler excavator is the trusted partner with you through it all. Wherever it goes, it earns more than its share of work, respect and profits. It’s got proven, industry-leading fuel economy and a legendary Volvo cab that’s better than ever.','ec210b_prime.pdf','','','','','','','',0,''),(31,'CRAWLER EXCAVATOR EC170D','EC170D','','','volvo-find-crawler-excavator-ec170d-t3-walkaround-1000x1000.jpg','volvo-show-crawler-excavator-ec170d-t3-star-picture-2324x1200.jpg',18,2,1,2,'2017-08-21 15:08:24','2017-08-21 15:08:24','0000-00-00 00:00:00','ec170d','','DESIGNED TO DELIVER','','EXCELLENT PERFORMANCE','','Introducing the Volvo EC170D crawler excavator, a new machine designed to deliver excellent performance and high fuel efficiency, combined with superior durability and ease of transport. This excavator is built to work on a range of jobs from construction to quarrying and site preparation and provides fast cycle times together with excellent digging and lifting capabilities.\r\n\r\n','ec170d.pdf','8yiqAEL5cVc','VOLVO EC170D CRAWLER EXCAVATOR PROMOTIONAL VIDEO','','Discover Volvo EC170D crawler excavator - engineered for efficiency and endurance.','','','',0,''),(32,'CRAWLER EXCAVATOR EC140D','EC140D','','','volvo-find-crawler-excavator-ec120d-t2-t3-semi-d-cab-1000x1000-01.jpg','volvo-show-crawler-excavator-ec120d-ec140d-t2-t3-semi-d-cab-2324x1200px.jpg',18,2,1,2,'2017-08-21 15:11:03','2017-08-21 15:11:03','0000-00-00 00:00:00','ec140d','','BOOST JOBSITE PROFITABILITY','','COMBINING HIGH FUEL EFFICIENCY, UPTIME AND PRODUCTIVITY TO BECOME THE ULTIMATE EARNING MACHINE','','Take command in the durably designed EC140D, featuring the latest fuel-efficient Volvo engine and enhanced hydraulics to deliver exceptionally high efficiency, rapid cycles and low fuel consumption. Thanks to ultimate machine availability, easy serviceability and performance-enhancing features, the robust excavator helps you do more and increase your profits.\r\n\r\n','ec140d.pdf','','','','','','','',0,''),(33,'COMPACT WHEEL LOADER L35B PRO','L35B Pro','','','volvo-find-compact-wheel-loader-l35bpro-t3-walkaround-small.jpg','volvo-show-compact-wheel-loader-l35bpro-t3-star-picture-big.jpg',19,2,1,2,'2017-08-21 15:46:33','2017-08-21 15:46:33','0000-00-00 00:00:00','l35b_pro','','MORE CARE, BUILT IN','','TAKE ON ANY JOB','','The Volvo L35B Pro compact wheel loader is packed with performance to give you a highly productive, highly versatile machine, bringing efficiency and performance to a new level. Volvo helps you do more than you ever thought possible.','l35bpro.pdf','','','','','','','',0,'');
